(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{64:function(e){e.exports={data:{blog:{title:"มาสร้าง expressJS router generator กัน",content:"<p><span style=\"color: rgb(226,80,65);font-size: 18px;\"><strong>*</strong></span> ต้องบอกก่อนว่าบทความนี้ไม่ได้สอนพื้นฐาน expressJS แต่ผมจะเสนอ 1 วิธีจัดการกับ expressJS router<span style=\"color: rgb(226,80,65);font-size: 18px;\"><strong>*</strong></span></p>\n<p>ใครที่มาใช้ NodeJS คงจะคุ้นเคยกับ expressJS เป็นอย่างดี สำหรับใครที่เป็นมือใหม่</p>\n<pre>const express = require('express')<br>const app = express()<br>const port = 3000<br><br>app.get('/', (req, res) =&gt; res.send('Hello World!'))<br><br>app.listen(port, () =&gt; console.log(`Example app listening on port ${port}!`))</pre>\n<p>ถ้ามือใหม่ขึ้นมาอีกหน่อยๆ</p>\n<pre>const express = require('express')<br>const app = express()<br>const port = 3000<br><br>app.get('/', (req, res) =&gt; res.send('Hello World!'))<br>app.get('/a', (req, res) =&gt; res.send('Hello World!'))<br>.<br>.<br>.<br>app.get('/z', (req, res) =&gt; res.send('Hello World!'))<br>app.listen(port, () =&gt; console.log(`Example app listening on port ${port}!`))</pre>\n<p></p>\n",cover:"https://storage.googleapis.com/myblog-7f48d.appspot.com/flamelink%2Fmedia%2F1545681926217_javascript14.png?GoogleAccessId=firebase-adminsdk-gd8gq%40myblog-7f48d.iam.gserviceaccount.com&Expires=16725225600&Signature=YAn4vLH4woui2cJpGrjI%2BbtL40frG1joswUcNJwJnwZlQGxF%2BCSL8gkb5qEELCtmckNjC4ekE8FXRbbt%2ByK9L7NbaKzlpdcAKSu%2BP7oeAwGaxg4bcU%2Bz19%2B0FwvvcSWRz2nT8DeY%2F8AfUgFJja6p8EHbVj6QN9QbEKY6Pve9PxIgtq0uHynODe35D%2BMWbxi%2Fz4BzW%2FblUdghi0EAxfpXy7fXkrw4NqugeYBiY8%2BV0LtmqdeCE%2FfD6zvq0bJ8fPlFsWJ5eg%2Fmg1csy6hHKVuXeOnfmcwqT6XAJMFfyDwmVxNBr05JDpHnECwXWHzHV6n5wNNBfenznjRgkgXGepCfyg%3D%3D",author:"lagmanzaza",date:"2018-12-25T02:44:13+07:00"}}}}}]);